class Solution:
    def numSubarrayProductLessThanK(self, nums, k):
        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """
        n = len(nums)
        count = 0
        
        index = 0
        endIdx = 0
        ss = 1
        while endIdx < n:
            ss *= nums[endIdx]
            while ss >= k and index <= endIdx:
                ss /= nums[index]
                index += 1
            
            count += endIdx - index + 1
            endIdx += 1
        return count
sol = Solution()
result = sol.numSubarrayProductLessThanK([10, 5, 2, 6], 100)
print(result)

